def event_scheduler(events):
    if not events:
        return "No events"

    start_times = [date.Date(start, date.FORMAT) for start, _ in events]
    end_times = [date.Date(end, date.FORMAT) for _, end in events]

    conflicts = []
    for i in range(len(events)):
        for j in range(i + 1, len(events)):
            if start_times[i] < end_times[j]:
                conflicts.append((start_times[i], end_times[j]))

    return "Conflict" if conflicts else "No conflicts"
